this.loadEntries = function() {
    apogeeapp.ui.removeAllChildren(this.selectedCell);
    apogeeapp.ui.removeAllChildren(this.availableCell);
    this.entryCellInfos = [];

    var addCombinedEntry = (combinedEntry) => {
        var entryCellInfo = this.createCellInfo(combinedEntry);
        if(combinedEntry.selected) {
            this.selectedCell.appendChild(entryCellInfo.element);
        }
        else {
            this.availableCell.appendChild(entryCellInfo.element);
        }
        this.entryCellInfos.push(entryCellInfo);
    }

    this.combinedEntries.forEach(addCombinedEntry);
}

this.createCellInfo = function(combinedEntry) {

    var name = combinedEntry.fileEntry.Fields.entry_name + " - " + combinedEntry.fileEntry.Fields.option_name;

    var div = document.createElement("div");

    var checkbox = document.createElement("input");
    checkbox.setAttribute("type", "checkbox");
    div.appendChild(checkbox);

    var text = document.createTextNode(name);
    div.appendChild(text);

    //tie the div to the combined entry
    var entryCellInfo = {};
    entryCellInfo.combinedEntry = combinedEntry;
    entryCellInfo.element = div;
    entryCellInfo.checkbox = checkbox;

    return entryCellInfo;
}

